#include <bits/stdc++.h>
using namespace  std;
string compressString(string S) {
    if(S.size() <= 2) {
        return S;
    }
    string res;
    int sum = 1;
    char c = S[0];
    for(int i = 1; i != S.size(); i ++){
        if(S[i] == c){
            sum++;
        }
        else{
            res +=  c + to_string(sum);
            c = S[i];
            sum = 1;

        }
    }
    res = res + c + to_string(sum);
    return res.size() > S.size() ? S : res;
}
